import React, { Component } from 'react';
import { Header, Content, ContentFunctional } from './components/header/header';
import { Game} from './components/gameComponents/game';
import './App.css';

class App extends Component {

   constructor(props) {
      super(props);
      this.state = { Counter: 1 };
      this.state = {
         data:
            [
               {
                  "id": 1,
                  "name": "Foo",
                  "age": "20"
               },
               {
                  "id": 2,
                  "name": "Bar",
                  "age": "30"
               },
               {
                  "id": 3,
                  "name": "Baz",
                  "age": "40"
               }
            ]
      }
   }

   updateCount = () => {
      this.setState({ Counter: this.state.Counter + 1 })
   }

   handleCount = () => {
      this.setState({});
   }
   render() {
      setTimeout(() => {
         this.updateCount();
      }, 5000);
      return (
         <div>
            <Header></Header>
            <Content text="Paragraph"></Content>
            <ContentFunctional text="text"></ContentFunctional>
            <Game></Game>
         </div>
      );
   }
}


export default App;
